import React from "react";

class Login extends React.Component {
  constructor() {
    super();
    this.state = {};
  }
  render() {
    return (
      <div className="login flex-col p-12 flex justify-center items-center">
        <h2 className="text-2xl p-2 blue">Login</h2>
        <form>
          <input
            className="text-xl rounded-md w-40 py-2 px-4 my-2 border-2 border-solid border-blue-900 text-blue-900"
            type="text"
            name="email"
          ></input>
          <input
            type="password"
            name="password"
            className="text-xl rounded-md w-40 py-2 px-4 my-2 border-2 border-solid border-blue-900 text-blue-900"
          ></input>
          <input
            className="text-xl rounded-md w-40 py-2 px-4 my-2 border-2 border-solid border-blue-900 text-blue-900 bg-blue-400"
            type="submit"
            value="Login"
          ></input>
        </form>
      </div>
    );
  }
}
export default Login;
